import React, { Component } from 'react';
import User from '../../models/User';
import UserComponent from '../userComponent/UserComponent';
import './usersSquares.css';


interface usersState {
    allUsers : User[];
    filteredUsers : User[];
}

export default class UsersSquares extends Component <any, usersState>  {

    constructor(props : any) {
        super(props);

        this.state = {
            allUsers: [
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
            ],
            filteredUsers : new Array <User> ()
        };
    }

    componentDidMount = () => {

    }


    render() {
        return (
            <div>
                <div className="allUsersSquares">
                    {this.state.allUsers.map( (user, index) => 
                        <div key={index} className="userSquare">
                            <UserComponent userDetails={user} />
                        </div>
                    )}
                </div>
            </div>
        )
    }
}
